ko -->\n\n        <!-- ko if: validateWholeGroup -->\n        <!-- ko  foreach: { data: elems, as: 'element' } -->\n            <!-- ko if: element.error() && element.visible() -->\n                <label class=\"error\" data-bind=\"attr: { for: uid }, text: element.error\"></label>\n            <!-- /ko -->\n        <!-- /ko -->\n        <!-- /ko -->\n    </div>\n</fieldset>\n","Magento_Ui/templates/tooltip/tooltip.html":"<!--\n/**\n * Copyright \u00c2\u00a9 2013-2017 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n<div data-tooltip=\"tooltip-wrapper\" class=\"data-tooltip-wrapper\">\n    <div class=\"data-tooltip-tail\"></div>\n    <div class=\"data-tooltip\">\n        <% if(data.closeButton){ %>\n            <button type=\"button\" class=\"action-close\">\n                <span translate=\"'Close'\"/>\n            </button>\n        <% } %>\n        <div class=\"data-tooltip-content\"></div>\n    </div>\n</div>\n","Magento_Ui/templates/form/field.html":"<!--\n/**\n * Copyright \u00c2\u00a9 2013-2017 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n<div class=\"field\" data-bind=\"visible: visible, attr: {'name': element.dataScope}, css: additionalClasses\">\n\n    <label class=\"label\" data-bind=\"attr: { for: element.uid }\">\n        <!-- ko if: element.label -->\n        <span data-bind=\"text: element.label\"></span>\n        <!-- /ko -->\n    </label>\n\n    <div class=\"control\" data-bind=\"css: {'_with-tooltip': element.tooltip}\">\n        <!-- ko ifnot: element.hasAddons() -->\n            <!-- ko template: element.elementTmpl --><!-- /ko -->\n        <!-- /ko -->\n\n        <!-- ko if: element.hasAddons() -->\n            <div class=\"control-addon\">\n                <!-- ko template: element.elementTmpl --><!-- /ko -->\n\n                <!-- ko if: element.addbefore -->\n                    <label class=\"addon-prefix\" data-bind=\"attr: { for: element.uid }\"><span data-bind=\"text: element.addbefore\"></span></label>\n                <!-- /ko -->\n\n                <!-- ko if: element.addafter -->\n                    <label class=\"addon-suffix\" data-bind=\"attr: { for: element.uid }\"><span data-bind=\"text: element.addafter\"></span></label>\n                <!-- /ko -->\n            </div>\n        <!-- /ko -->\n\n        <!-- ko if: element.tooltip -->\n            <!-- ko template: element.tooltipTpl --><!-- /ko -->\n        <!-- /ko -->\n\n        <!-- ko if: element.notice -->\n            <div class=\"field-note\" data-bind=\"attr: { id: element.noticeId }\"><span data-bind=\"text: element.notice\"></span></div>\n        <!-- /ko -->\n\n        <!-- ko if: element.error() -->\n            <div class=\"mage-error\" data-bind=\"attr: { for: element.uid }, text: element.error\" generated=\"true\"></div>\n        <!-- /ko -->\n\n        <!-- ko if: element.warn() -->\n            <div class=\"message warning\" generated=\"true\"><span data-bind=\"text: element.warn\"></span></div>\n        <!-- /ko -->\n    </div>\n</div>\n<!-- /ko -->\n","Magento_Ui/templates/form/collection.html":"<!--\n/**\n * Copyright \u00c2\u00a9 2013-2017 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n<each args=\"data: items, as: '$item'\">\n    <each args=\"$item\" render=\"\"/>\n</each>\n","Magento_Ui/templates/form/fieldset.html":"<!--\n/**\n * Copyright \u00c2\u00a9 2013-2017 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n<div class=\"fieldset-wrapper\"\n     css=\"$data.additionalClasses\"\n     attr=\"'data-level': $data.level, 'data-index': index\"\n     data-bind=\"visible: $data.visible === undefined ? true: $data.visible\">\n    <div class=\"fieldset-wrapper-title\"\n         attr=\"tabindex: !collapsible ? -1 : 0,\n               'data-state-collapsible': collapsible ? opened() ? 'open' : 'closed' : null\"\n         click=\"toggleOpened\"\n         keyboard=\"13: toggleOpened\"\n         if=\"label\">\n\n        <strong css=\"'admin__collapsible-title': collapsible,\n                      title: !collapsible,\n                      '_changed': changed,\n                      '_loading': loading,\n                      '_error': error\">\n            <span translate=\"label\"/>\n            <span class=\"admin__page-nav-item-messages\" if=\"collapsible\">\n                <span class=\"admin__page-nav-item-message _changed\">\n                    <span class=\"admin__page-nav-item-message-icon\"></span>\n                    <span class=\"admin__page-nav-item-message-tooltip\"\n                          data-bind=\"i18n: 'Changes have been made to this section that have not been saved.'\">\n                    </span>\n                </span>\n                <span class=\"admin__page-nav-item-message _error\">\n                    <span class=\"admin__page-nav-item-message-icon\"></span>\n                    <span class=\"admin__page-nav-item-message-tooltip\"\n                          data-bind=\"i18n: 'This tab contains invalid data. Please resolve this before saving.'\">\n                    </span>\n                </span>\n                <span class=\"admin__page-nav-item-message-loader\">\n                    <span class=\"spinner\">\n                       <span repeat=\"8\"/>\n                    </span>\n               </span>\n            </span>\n        </strong>\n    </div>\n\n    <div class=\"admin__fieldset-wrapper-content\"\n         css=\"'admin__collapsible-content': collapsible, '_show': opened, '_hide': !opened()\">\n        <fieldset\n                if=\"opened() || _wasOpened\"\n                class=\"admin__fieldset\"\n                each=\"data: elems, as: 'element'\" render=\"\"/>\n    </div>\n</div>\n","Magento_Ui/templates/form/insert.html":"<!--\n/**\n * Copyright \u00c2\u00a9 2013-2017 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n\n<div data-bind=\"